# Split the transaction_hashes into chunks of 100
batch_size = 10
batches = [transaction_hashes[i:i + batch_size] for i in range(0, len(transaction_hashes), batch_size)]

# Initialize an empty list to store the results from each batch
all_results = []

# Create the SQL query and execute for each batch
for i, batch in enumerate(batches, 1):
    # Join the hashes in the batch to form a string for the SQL query
    batch_hashes = ", ".join([f"'{hash}'" for hash in batch])
    
    # Create the SQL query for the current batch
    sql_query = f"""
    SELECT
        u.first_name,
        u.last_name,
        u.user_id,
        u.mobile_nr,
        u.email,
        t.transaction_hash,
        t.type,
        t.counterparty_first_name,
        t.counterparty_last_name
    FROM
        users u
    JOIN transfers t ON u.user_id = t.user_id
    WHERE
        t.transaction_hash IN ({batch_hashes});
    """
    
    # Execute the query and load it into a pandas DataFrame
    df_batch = pd.read_sql(sql_query, engine)
    
    # Append the result to the all_results list
    all_results.append(df_batch)
    
    # Print progress
    print(f"Batch {i} of {len(batches)} is completed")

# Concatenate all the DataFrames into a single DataFrame
final_df = pd.concat(all_results, ignore_index=True)

# Export the result to CSV
csv_file_path = '/Users/pranay/Documents/GitHub/personal-repos/python-mysql/crypto_transactions_result.csv'
final_df.to_csv(csv_file_path, index=False)

print(f"Results exported to {csv_file_path}")